import React, {Component} from 'react';

import '../App.css'
import { Grid, Cell } from "react-mdl";

class Home extends Component {
    render() {
        return (
            <div className="landcontainer">

                <Grid className="landGrid">
                    <Cell col={12}>
                        <img
                            className="avatar-img"
                            src="https://thumbs.dreamstime.com/z/girl-lovely-avatar-blonde-hair-cartoon-icon-stock-vector-93364827.jpg" />

                            <div className="banner-text">
                                <h4>Full Stack WEb Developer</h4>
                                <hr/>
                                <p>HTML/CSS | JavaScript | React | NodeJs | Express | MongoDB</p>


                                <div className="social-links">

                                    {/* LinkedIn */}
                                    <a href="http://google.com" rel="noopener noreferrer" target="_blank">
                                        <i className="fa fa-linkedin-square"  aria-hidden="true"></i>
                                    </a>

                                    {/* Github */}
                                    <a href="http://github.com" rel="noopener noreferrer" target="_blank">
                                        <i className="fa fa-github-square"  aria-hidden="true"></i>
                                    </a>

                                    {/* freecodecamp */}
                                    <a href="http://freecodecamp.com" rel="noopener noreferrer" target="_blank">
                                        <i className="fa fa-free-code-camp"  aria-hidden="true"></i>
                                    </a>

                                    {/* youtube */}
                                    <a href="http://youtube.com" rel="noopener noreferrer" target="_blank">
                                        <i className="fa fa-youtube-square"  aria-hidden="true"></i>
                                    </a>

                                </div>

                            </div>
                    </Cell>




                </Grid>


            </div>
        );
    }
}

export default Home;
